import React from 'react'
import Bugs from "../Components/Assets/images/Bugs.svg";
import Dependencies from "../ProjectDetailsPage/Components/Assets/images/Dependencies.svg";
import CodeReview from "../Components/Assets/images/CodeReview.svg";
import UnitTesting from "../Components/Assets/images/UnitTesting.svg";
import Delay from "../Components/Assets/images/Delay.svg";
import ProjectCardData from './ProjectCardData';

const ProjectCard = () => {

    const card = [{
        logo: Bugs,
        count: 105,
        name: "NewBugs",
        chart:true
    },
    {
        logo: Dependencies,
        count: 45,
        name: "Dependencies",
        chart:true
    },
    {
        logo: CodeReview,
        count: "12%",
        name: "CodeReview",
        chart:true
    },
    {
        logo: UnitTesting,
        count: "8%",
        name: "UnitTesting",
        chart:true

    },
    {
        logo: Delay,
        count: "45%",
        name: "Delay",
        chart: false
    },
    ]
    return (
        <div>
            <div className='ProjectCard-Contain'>
                {card && card.map((data) =>
                    <ProjectCardData data={data} />
                )}
            </div>
        </div>
    )
}

export default ProjectCard;
